import ListHeader from './components/ListHeader';

const App = () => {
  return (
    <div className="min-h-screen bg-[rgb(233,241,249)] flex items-center justify-center">
      <div className="app bg-white shadow-md rounded-lg p-4 w-[800px] ">
        <ListHeader listName={'Task manager'} />
      </div>
    </div>
  );
};

export default App;
